Directed by Matthew Diamond. 

With Demi Lovato, Joe Jonas, Meaghan Martin, Maria Canals-Barrera. 

At an music camp for gifted teens, a popular teen idol overhears a girl singing and sets out to find who the talented voice belongs to. What he doesn't know is that the girl is actually a camp kitchen worker with a fear of being heard.


Camp Rock 2: The Final Jam &lt;a href=&quot;
http://www.imdb.com/title/tt1252380/&quot; rel=&quot;nofollow&quot; target=&quot;_NEW&quot;&gt;
http://www.imdb.com/title/tt1252380/&lt;/a&gt;

Mitchie can't wait to return to camp rock so that she and nice guy rock star Shane can spend the summer making music and having fun with their friends and band mates. But Shane finds himself too busy teaching classes and helping Uncle Brown run the camp to have much fun. Mitchie meets a handsome and talented musician (Luke) from the slick new camp across the lake, and he has all the time in the world for her. All Mitchie's loyalties are tested and she eventually has to choose between Shane and Luke at a dramatic battle of the bands between the rival camps. 

Director: Paul Hoen

With Demi Lovato, Joe Jonas and Nick Jonas
